  false,\n\t\"url\": null,\n\t\"notes\": \"This side scan sonar imagery of the sea
  floor (70-90 m water depths) was mosaiced from acoustic data collected in 2006 aboard
  the R/V Tatoosh. A Klein System 3000 dual frequency side scan system was used for
  geophysical surveying, using only the 100Khz data to create the mosaic. A Trimble
  DSM212Ldifferential GPS was used for towfish positioning. Navigation from the GPS
  was logged in Hypack Max. Isis Sonar (Triton Imaging International) was used to
  log the digital sonar packets and cable counter data. Sonar data were captured using
  the 150m range scale setting.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
